import React from "react";

export default function Header() {
  return (
    <header>
      <nav className="nav">
        <img
          className="nav-image"
          src="./public/logo512.png"
          alt="react logo"
        />
        <ul className="nav-items">
          <li>Pricing</li>
          <li>About</li>
          <li>Contact</li>
        </ul>
      </nav>
    </header>
  );
}
